import React, { Component } from "react";
import FoodItem from './../foodItem';

const items = [
  {
    name: "Chicken Momo"
  },
  {
    name: "Veg Momo"
  }
];

class FoodItems extends Component {

  render() {
    return (
      <div>
        <h2>Our Menu</h2>
        {
          items.map(item => (
            <FoodItem name={item.name}></FoodItem>
            //<li>Test</li>
          ))
        }

      </div>
    );
  }
}

export default FoodItems;
